window.bookSummaryJSON = "<p><b>\"I’ll marry you Sunshine,\" his eyes gleam, \"on one condition.\"</b></p> <p><b>\"What?\" I whisper, \"what is it?\"</b></p> <p><b>\"I get equal stake in the Cosa Nostra business.\"</b></p> <p>He’s my second chance. </p> <p>The man with the face of my first love. </p> <p>A terrifying and magnetically gorgeous man with brutal blue eyes. </p> <p>An outlaw whose very presence sucks the air from my lungs. </p> <p>A monster who doesn't remember his past, whose soul is shrouded in scars, pain, and darkness. </p> <p>A villain who refuses to acknowledge my very existence. </p> <p>The rogue who I am going to marry, for this may be the only chance I have to find happiness. </p> <p>So what if it means binding myself to a man who hates me?</p> <p>Except \"until death do us part\" is going to come quicker than anyone knows....</p> <p><b>A brute of a Mafia guy clashes with a firebrand florist who refuses to take no for an answer in this intensely emotional pretend marriage, dark mafia romance. This is a complete stand-alone. No other books should be listened to prior to this. One-click </b><b><i>now</i></b><b>!</b></p>"; 
